import React from 'react'

function AboutFreeTrial() {
    return (
        <div class="book-container">
            <h1 class="booking-head">Book a free trial</h1>
            <p class="booking-para">Contact Gen Alpha +919153278835 or write to <a href="mailto:genalphatutoring@gmail.com" class="mailto">genalphatutoring@gmail.com</a> in case of queries!</p>
            <a href="/" class="booking-free-trial_btn">Book Now</a>
        </div>    
    )
}

export default AboutFreeTrial
